       const Comments = {
              loop:true,
              autoplay: true,
              animationData: animationData,
              rendererSettings: {
                     preserveAspectRatio: "xMidYMid slice"
              }
       };
       return (
              <div>
                     <Lottie 
                     options={Comments}
                     width={120}
                     height={150}
                     />
              </div>
       )
}
